INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (8, 'Suitable for any type of riding, on or off-road. Fits any budget. Smooth-shifting with a comfortable ride.', '8e6746e5-ad97-46e2-bd24-fcea075c3b52', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (64, 'This bike delivers a high-level of performance on a budget. It is responsive and maneuverable, and offers peace-of-mind when you decide to go off-road.', '7b1c4e90-85e2-4792-b47b-e0c424e2ec94', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (88, 'For true trail addicts.  An extremely durable bike that will go anywhere and keep you in control on challenging terrain - without breaking your budget.', '4c1ad253-357e-4a98-b02e-02180aa406f6', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (128, 'Serious back-country riding. Perfect for all levels of competition. Uses the same HL Frame as the Mountain-100.', '130709e6-8512-49b9-9f62-1f5c99152056', '2008-03-11 10:32:17.973+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (168, 'Top-of-the-line competition mountain bike. Performance-enhancing options include the innovative HL Frame, super-smooth front suspension, and traction for all terrain.', 'db979da6-4cc8-4171-9ecf-65003ff8178a', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (170, 'Suitable for any type of off-road trip. Fits any budget.', 'ea772412-6369-4416-9cc9-c1a5d1ff9c52', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (209, 'Entry level adult bike; offers a comfortable ride cross-country or down the block. Quick-release hubs and rims.', 'f5ff5ffd-cb7c-4ad6-bbc9-4d250bb6e98d', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (249, 'Value-priced bike with many features of our top-of-the-line models. Has the same light, stiff frame, and the quick acceleration we''re famous for.', '4291f144-7693-4460-8b0b-1373e0433021', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (320, 'Same technology as all of our Road series bikes, but the frame is sized for a woman.  Perfect all-around bike for road or racing.', 'e130ded9-d0ec-4656-bf4d-1a3a46491891', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (321, 'Same technology as all of our Road series bikes.  Perfect all-around bike for road or racing.', 'c7b429da-dc51-47db-a18e-5891e76ccc16', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (337, 'A true multi-sport bike that offers streamlined riding and a revolutionary design. Aerodynamic design lets you ride with the pros, and the gearing will conquer hilly roads.', 'db560f0b-e70b-42a7-a1f5-3b7e42d3679d', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (375, 'Cross-train, race, or just socialize on a sleek, aerodynamic bike.  Advanced seat technology provides comfort all day.', '747b2185-0320-4fe5-8e8f-27b84a40a838', '2007-06-01 00:00:00+00');
