INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (409, 'Alluminum-alloy frame provides a light, stiff ride, whether you are racing in the velodrome or on a demanding club ride on country roads.', '3dc76714-7572-4547-9d79-abb708950b2c', '2007-06-01 00:00:00+00');
