INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1484, 'Acier chromé.', '7f3423f0-9ef6-460e-a08a-925aefabd39a', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1485, 'Cuvettes en alliage d''aluminium ; axe de grand diamètre.', 'dbf35181-8cd5-4641-bab5-6bdfa8441112', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1486, 'Cuvettes en alliage d''aluminium et axe creux.', '3d57ba93-2856-4ff7-8b17-8dbed99109ab', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1487, 'Adapté à tous les usages, sur route ou tout-terrain. Pour toutes les bourses. Changement de braquet en douceur et conduite confortable.', '5c1dab3a-4b31-4d9d-a14f-3cb61949b79b', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1488, 'Ce vélo offre un excellent rapport qualité-prix. Vif et facile à manœuvrer, il se conduit en toute tranquillité sur les chemins et les sentiers.', '79065ec8-2080-4120-a4ea-bfa7ea1f1f9d', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1489, 'Pour les véritables passionnés du VTT. Un vélo extrêmement robuste qui vous permettra d''aller partout, même sur les terrains difficiles, pour un budget raisonnable.', '93463372-82ef-4ec4-ba0f-da371a6fbef6', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1490, 'Conduite sur terrains très accidentés. Idéal pour tous les niveaux de compétition. Utilise le même cadre HL que le Montain-100.', '2b6fa2a7-4815-47b6-a6bc-d6aec23b85cc', '2008-03-11 10:32:17.973+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1491, 'VTT de compétition haut de gamme. Plusieurs options d''amélioration des performances : cadre HL, suspension avant particulièrement souple et traction adaptée à tous les terrains.', '3d73a955-289a-47c1-bf47-596eb0cbbaa1', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1492, 'Adapté à tous les terrains. Pour toutes les bourses.', '2198e171-cf84-44e2-8b73-342a45e18366', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1493, 'Vélo d''adulte d''entrée de gamme ; permet une conduite confortable en ville ou sur les chemins de campagne. Moyeux et rayons à blocage rapide.', '7943455f-3fbe-44c0-9ac2-7ee642d3944b', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1494, 'Vélo très séduisant comportant de nombreuses caractéristiques des modèles haut de gamme. Bénéficie du cadre léger et rigide, mais aussi de la ligne performante qui ont fait notre réputation.', '485b21fe-a5b5-4df2-a2f8-3de106f08ef1', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1495, 'Équipé de la même technologie que tous nos vélos de route, avec un cadre femmes. Idéal pour la promenade ou la course sur route.', '8b97634a-52f9-4a5c-93ea-6b6b15d1f5dd', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1496, 'Équipé de la même technologie que tous nos vélos de route. Idéal pour la promenade ou la course sur route.', '33060e1f-c997-4d6a-ade7-c68fb620d5ce', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1497, 'Un véritable vélo multi-sports, qui offre une conduite optimisée et une ligne révolutionnaire. Sa ligne aérodynamique vous permet de l''utiliser en course et ses vitesses de gravir les cols.', '3e4964dc-a697-481f-9374-e6f67e89808d', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1498, 'VTT, course ou promenade entre amis sur un vélo aérodynamique et léger. Bénéficie d''un système de selle perfectionné qui offre un confort optimal.', 'f484e5c5-bfd4-4220-8b2a-677f2f49b3ee', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1499, 'Tout terrain, course ou promenade entre amis sur un vélo aérodynamique et léger (cadre femmes). Bénéficie d''un système de selle perfectionné qui offre un confort optimal.', '559c08ef-739c-4979-88e0-8165f9f6ba77', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1500, 'Cadre en alliage d''aluminium qui offre une conduite légère et rapide, sur pistes ou sur routes de campagne.', 'de8dfd6b-a04f-4865-99a1-a2a88ce92993', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1501, 'Ce vélo est destiné aux champions cyclistes. Mis au point par une équipe cycliste professionnelle, ce vélo possède un cadre en aluminium traité à chaud extrêmement léger et un guidon qui permet une conduite très précise.', '710c56b1-c463-48ff-87f1-15d2ea58b029', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1502, 'Vélo de qualité pour tous usages, doté d''un bon niveau de confort et de sécurité. Présente des pneus plus larges et plus stables pour les sorties en ville ou les randonnées du week-end.', 'e5288050-bc5b-45cc-8849-c7d4af2fe2b6', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1503, 'La selle rembourrée offre un confort optimal. Le porte-bagages nouvellement remanié offre diverses possibilités d''ajout de paniers ou de sacoches. Ce vélo reste parfaitement stable une fois chargé.', '28b132c3-108c-412d-9918-a8c9297dfb73', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1504, 'Voyagez confortablement et avec élégance. Confort et sécurité maximum. Large éventail de vitesses pour gravir toutes les côtes. Sa fabrication en alliage d''aluminium haute technologie est synonyme de robustesse, sans ajout de poids.', 'e3bac4a6-220c-4e5e-8261-51e08906c0e8', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1505, 'Système de changement de vitesse très performant.', '426fe762-42c4-4843-9c02-b6fa45ecc29c', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1506, 'Axe très rigide.', '73983734-e8f7-4681-9d7f-9abad24bb609', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1507, 'Manivelle haute résistance.', '1075b851-8aef-46c8-9a97-d45e1b23398c', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1508, 'Pédalier triple plateaux ; manivelle en aluminium ; changement de braquet impeccable.', '7d23fb50-63d3-4f41-adab-ebab93846bf7', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1509, 'Patins de freinage pour tous les temps ; freinage renforcé par l''application d''une plus grande surface sur la jante.', '5ed8186a-6049-42b1-b1b0-3b1f899c538b', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1510, 'Conception liaison large.', '64723c0c-09d5-497d-83a3-4561818a8f1c', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1511, 'Conception robuste permettant d''absorber les chocs et d''offrir une conduite plus précise.', '4e0f2242-6ee6-4757-8ecf-0b9e0c23304d', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1512, 'Fourche composite pour route avec tube de direction en aluminium.', '04902a2e-7819-4ebe-bc8a-8a115df1356e', '2007-06-01 00:00:00+00');
