INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1514, 'Utilise la même technologie de cadre que celle adoptée sur le cadre en aluminium ML.', 'f5d3b83b-8a70-4a64-84ab-8afe20d5791d', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1515, 'Le cadre ML est un cadre en aluminium traité à chaud fabriqué avec le même niveau de détail et de qualité que notre cadre HL. Il offre des performances exceptionnelles. Version hommes.', 'dba0a067-f4ff-450b-b33c-65e2eab7afbc', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1516, 'Le cadre ML est un cadre en aluminium traité à chaud fabriqué avec le même niveau de détail et de qualité que notre cadre HL. Il offre des performances exceptionnelles. Version femmes.', 'ce88bac5-991c-49bb-a970-34aac6458a80', '2007-06-01 00:00:00+00');
INSERT INTO "public"."ProductDescription" ("ProductDescriptionID", "Description", "rowguid", "ModifiedDate") VALUES (1517, 'Doté du même alliage en aluminium que notre cadre HL haut de gamme, le ML possède un tube léger dont le diamètre est prévu pour offrir une résistance optimale. Version femmes.', 'f3cd990a-b70d-43c8-a075-934a3e98b5aa', '2007-06-01 00:00:00+00');
